import React from 'react';
import logo from './images/logo.svg';
import {About} from './components';
import './App.css';

function App() {
  return (
    <div>
      <header className="header">
        <div className="logo">
          <img src={logo}  alt="logo" />
        </div>
      </header>
      <About/>
    </div>
  );
}

export default App;
